import './Footer.css'

const JoinUs = (props) => {
    return (
        <div>
            <div className='image-footer'></div>
            <div className='footer-detail-join'>
                <p className='title'>Ready to start an Online Shop? Join Us!</p>
            </div>
        </div>
    )
};

export default JoinUs
